description:
Gantungan Baju Citra Jaya Plastic isi 12pcs terbuat dari bahan yang sangat kokoh sehingga dapat menahan beban lebih dibandingkan merk lainnya.

Untuk melihat jenis gantungan baju lainnya;
https://www.tokopedia.com/floeshop/etalase/gantungan-baju

Miyako KG302C – Kompor Gas 2 Tungku Kuningan terbuat dari material ceflon, menjadikan desain kompor lebih kuat. Api ekonomis dengan burner kuningan berkualitas, memungkinkan panas lebih cepat dan merata. Aneka masakan pun lebih cepat matang, tanpa menunggu lama.

Varian kompor lainnya;
https://www.tokopedia.com/floeshop/etalase/kompor
